import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {<CryptoTable />}
    </div>
  );
}



function CryptoTable() {

  const {data,setData} = useState("");

  useEffect(() => {
    async function fetchData() {
      const res = await fetch("http://localhost:8080/ExcerciseThursday/api/crypto");
      res.json().then(res => setData(res));
    }
    console.log(res);
    fetchData()
  })

  return (
    <div>{data}</div>
  )
}

export default App;
